-- ----------------------------
-- Records of newslist
-- ----------------------------
INSERT INTO `newslist` VALUES (1, '刘国栋副校长到图书馆检查指导工作', '2020-03-20 20:04:27', 'data:image/png;base64,', '2020年3月17日下午，刘国栋副校长到图书馆就疫情防控工作进行检查指导，资产管理处处长杨敏、后勤与基建管理处副处长黄岳文陪同。\r\n馆长杨勇就图书馆疫情防控期间的线上服务、场馆管理、人员管理、服务措施等进行了汇报，邹富联、黎邦群两位副馆长也分别就所分管部门开展的服务工作作了汇报。\r\n刘国栋副校长充分肯定了图书馆在疫情防控期间为满足全校师生的文献信息需求，保障学校的网络教学、科研工作付出的努力。他强调，一定要高度重视疫情防控，高度重视安全管理。一是做好科学防控，做好疫情防控工作预案；二是工作人员管理要到位，要充分关心和掌握老师的健康状况；三是保证防疫工作的安全管理，确保防疫物资的落实；四是有序推进图书馆各项工作，加强图书馆文献资源保障体系建设，提升教学科研和社会化服务功能，使图书馆成为学校的知识中心、学习中心、文化中心和服务中心。\r\n\r\n撰稿：黄晓芳\r\n审稿：邹富联\r\n签发：杨勇\r\n');
INSERT INTO `newslist` VALUES (2, '全面开展线上服务 助力师生教学科研', '2020-03-11 20:06:22', 'data:image/png;base64,', '在疫情防控期间，我馆坚决贯彻落实上级和学校的决策部署，把疫情防控工作作为当前最重大的政治任务和头等大事贯彻落实，完成各项防控工作要求，采取有力举措，积极做好防控工作。同时，全面开展线上服务，为全校师生在疫情时期的网络教学、科研工作和自主学习提供有力保障。\r\n疫期闭馆但服务不间断。为配合新型冠状病毒感染的肺炎疫情防控工作，有效避免人员聚集可能引发的疫情蔓延，最大限度保障读者和工作人员身体健康及生命安全，根据有关工作要求，我馆自1月26日起延迟开放，闭馆期间，数据库服务正常开展，师生可以全天候无障碍利用图书馆的电子资源。\r\n编制在线服务工作指引。编制《疫情防控期间图书馆在线服务工作指引》，内容包括资源介绍、电子资源访问操作指引、获取教学资源方式等，以便更好地为全校师生的网络教学、科研和学习提供信息资源保障。\r\n畅通师生远程访问数字资源途径。通过与学校信息技术中心和相关数据库服务商积极沟通协作，采取各种技术手段，为我校师生提供多种从校外访问图书馆数字资源的方式，满足疫情期间师生足不出户的教学、科研和学习需求。全力保障数字资源和信息服务平台的正常运行，通过学校的VPN系统，全校师生均可访问图书馆所有数字资源。\r\n加强电子资源推介服务。积极推送有关防疫科普读物，及时汇总并发布线上免费学习资源以及师生利用图书馆资源指引，通过微信公众号推出《图书馆与你一起战“疫”－－以读攻“毒”，共读经典》、《近期免费开放数据库利用指南》系列、《各类教学服务资源使用指南》、《开放获取资源推荐－－文史研究篇》等推文，并在图书馆主页和公众号推出教学科研参考资料，包括：1、具有特色的专业教学、考试网站与辅助资料；2、线上教学培训、指导与激励专题资料；3、教师备课参考资料；4、高校在线教学相关资讯等等，满足师生宅家抗疫的教学、科研和学习的需求。\r\n提供情报检索利用及在线咨询服务。通过电子邮件、电话咨询、微信群等方式，提供查收查引、科技查新、文献查询与传递等服务，保障全校师生的需求。建立教师服务微信群2个，进群教师达670多人次，由馆员和数据服务提供商提供相关的疑点解答、文献查询及文献传递服务，自2月1日至3月10日的近40天时间里，共提供文献代查代检及传递服务数量达1655项（篇），平均每天40多项（篇）。同时，安排专人在线值守，以图书馆主页和微信公众号作为服务接待窗口，及时为师生解答在资源利用与学习过程中遇到的各类问题，帮助师生准确、快速地找到需要的文献信息资料。\r\n做好网络技术支持，确保线上服务正常化。安排技术人员进行机房服务器与网络的日常维护与管理，确保各类网络服务正常开展，具体包括：1、安排专人在图书馆机房值班，进行服务器和网络设备的日常维护与升级，确保各类业务数据安全可靠，与正常运行；2、为全校师生提供图书馆网络与电子资源访问、下载相关资源的技术咨询服务。\r\n做好开馆前的工作预案。为使读者安心利用所借图书，我馆及时发布延期还书通知，所有外借图书不计逾期。目前，我馆正积极做好正式开学后开馆的防疫工作预案，包括场馆的清洁消毒、进馆人员的管理、借还图书的杀菌处理等，牢记初心与使命，坚持以师生为本，确保疫情防控和服务师生两不误。\r\n \r\n撰稿：黄晓芳\r\n审稿：杨勇  \r\n签发：杨勇\r\n');
INSERT INTO `newslist` VALUES (3, '与退休员工共话新春，不忘初心唱响未来', '2020-01-12 20:06:58', 'data:image/png;base64,', '1月11日下午，图书馆在图书馆学术报告厅举办“不忘初心，唱响未来”新春茶话会。图书馆全体员工与退休老员工欢聚一堂，同庆新春，共叙图书馆的发展。\r\n馆长杨勇简要汇报了一年来图书馆工作所取得的成绩，代表班子对全体员工一年来的辛勤付出表示衷心的感谢，希望退休老员工常回来看看，并对在场所有员工致以新年问候和诚挚祝福。他表示，图书馆能有今天的大好局面，离不开大家的关心和支持，在新的一年里，我们将以习近平新时代中国特色社会主义思想为指导，不忘初心，砥砺前行，不断提高服务能力，不断提升服务水平，全心全意为学校的教学科研服务。\r\n茶话会上，员工们纷纷拿出了自己的拿手节目，舞蹈、朗诵、唱歌、太极、游戏等轮番上阵，精彩连连。亲子舞蹈与退休员工史丹灵老师的两首独唱《我爱你，中国》、《我和我的祖国》将茶话会的氛围推向了高潮，整个会场欢声笑语，掌声不断，洋溢着欢快和谐的气氛。\r\n通过本次茶话会，加强了图书馆员工之间的了解与交流，增进了图书馆团队的凝聚力和向心力，进一步促进了团结友爱、合作奋进的和谐团队建设，树立了图书馆文化新形象。\r\n撰稿：黄晓芳       审稿\\签发：杨勇\r\n\r\n');
INSERT INTO `newslist` VALUES (4, '图书馆第一期最佳影评人评选结果出炉', '2020-01-08 20:08:11', 'data:image/png;base64,', '为丰富校园文化生活，提高师生对影视的理解和鉴赏水平，2019年12月，图书馆举办了以“人生·奋斗·幸福”为主题的影视展播暨首届最佳影评人争霸大赛。此次活动是最佳影评人争霸大赛的第一期，面向全校师生，以《当幸福来敲门》、《美丽心灵》、《心灵捕手》这三部影片为评论对象，旨在弘扬主旋律，传播正能量。截至2019年12月31日，本次大赛共收到影评30余篇，经查重及专家评选，精选出3篇优秀影评。获奖名单如下：\r\n奖项	获奖者	影评题名	奖品\r\n一等奖	古少红\r\n（17广播电视学1班）	在最艰苦的时候，不妨寻曾经所拥有的	保温杯（tiger）\r\n二等奖	张秀玲\r\n（汉语言文学）	那个努力向幸福靠近的人，像极了我们	U盘\r\n（爱国者）\r\n三等奖	高惠旭\r\n（18法学2班）	美丽心灵，生而不息	充电宝\r\n颁奖仪式将在第二期影视展播上举行。敬请关注！\r\n \r\n \r\n \r\n                                                                    惠州学院图书馆\r\n                                                                     2020年1月8日\r\n');
INSERT INTO `newslist` VALUES (5, '喜讯：我校师生参加2019年Socolar学术资源平台有奖知识竞赛获佳绩', '2020-01-08 20:09:04', 'data:image/png;base64,', '为了帮助用户提升文献资源的快速检索和有效利用的能力，教图公司在2019年10月至12月期间开展了Socolar 2019全国有奖知识竞赛。我校师生积极参与，喜获佳绩。\r\n获奖情况如下:\r\n二等奖1名：杨明恒\r\n三等奖4名：李丹玲（教师）、李心言、李位俊、梁智婷\r\nSocolar工作人员将跟进奖品发放事宜，请获奖者关注电邮和电话。\r\n');
INSERT INTO `newslist` VALUES (6, '图书馆落实主题教育精神，多举措服务教学与科研', '2020-01-03 20:12:24', 'data:image/png;base64,', '  学校“不忘初心，牢记使命”主题教育开展以来，图书馆努力践行初心和使命，聚焦服务师生，增强服务意识，在文献资源保障、创新学科服务、阅读推广等方面多措并举，主动服务教学科研。\r\n  一是开展院系调研工作，把准师生服务需求。为了解师生文献需求，由馆领导带队，深入到各二级学院，对图书馆的资源配置、学科服务等方面进行调研，了解师生的文献需求，认真收集、汇总并及时跟进各学院对图书馆提出的意见和建议，科学配置文献资源，优化服务，严把采选，在尽力满足师生文献需求的同时，积极服务学校学科发展。通过调研，图书馆与院系之间增进了了解，精准把握需求，进一步服务教学科研、服务学科建设。\r\n  二是开展个性化的资源与服务推介，满足院系专业化需求。针对各院系的专业化需求，开展个性化的数字资源专题讲座，同时进行图书馆服务推介，共达24场次，参加人数逾1000人。在讲座、推介过程中，加强师生与图书馆的互动交流，引导师生积极参与数字资源的体验，在体验中推广数字资源，提升数字资源在师生中的影响力，有效提高了文献信息资源的利用率，进一步提升了图书馆的服务成效。\r\n  三是开展学科评价分析与知识产权宣传，创新学科服务。不断开拓服务领域，为了客观反映我校的科研现状及水平，撰写了学科分析报告《2018年惠州学院国际论文统计与分析年报》，统计和分析了我校科研人员被 SCIE、SSCI、A&HCI、EI、CPCI-S、CPCI-SSH 六大索引收录的论文情况，为我校学科建设提供了数据支撑，为管理部门提供了科学定量参考，同时也为科研人员提供了评价自身学术影响力依据；不断探索知识产权服务，获得了惠州市知识产权宣传项目和广东省教育厅校企协同育人项目的立项支持，开展知识产权宣传周活动，先后推出知识产权海报展板宣传、知识产权线上讲座等活动，宣传普及知识产权知识，不断提升师生的知识产权意识，营造我校尊重和保护知识产权的良好氛围。\r\n  四是开展多样化的阅读推广活动，丰富校园文化。在图书馆网站及微信公众号定期推送精品图书，促进阅读，提升素质；举办《中外文明图片展》、“不忘初心、服务教研”图书展、东坡寓惠书画作品展等；举办电影展播、最佳影评人争霸大赛、真人图书分享会等，弘扬主旋律，传播正能量；积极办好图书馆读书会，旨在使读书会成员学习知识，交流思想，彼此分享与共进。丰富多彩的活动，丰富了校园文化生活,营造了浓厚的校园文化氛围，使图书馆真正成了学生的学习中心与交流中心。\r\n  图书馆将继续本着服务师生的初心，积极创新服务模式，着力提升服务水平和服务质量，为广大师生提供更优质的服务，为学校的教学科研事业贡献力量。\r\n');
INSERT INTO `newslist` VALUES (7, '图书馆举办梁力文东坡诗意书画展暨捐赠仪式', '2019-12-31 20:13:22', 'data:image/png;base64,', '2019年12月27日上午，图书馆在图书馆东座一楼热门书库举办梁力文东坡诗意书画展暨捐赠仪式，仪式由图书馆副馆长邹富联主持，党委副书记、纪委书记罗川山、惠州市作家协会吴振尧副主席等嘉宾、图书馆工作人员、部分学生代表参加了仪式。\r\n  仪式上，图书馆副馆长邹富联对图书馆的特藏文献收藏情况作了简要的介绍。梁力文先生是我校的校友，他表示，能够将自己的作品捐赠给母校图书馆收藏而感到非常自豪和幸福。接着，图书馆馆长杨勇代表我校图书馆接受梁力文先生的捐赠，并向梁力文先生颁发收藏证书。\r\n委副书记、纪委书记罗川山代表学校讲话，他首先感谢了梁力文先生对我校图书馆工作的支持，他说，梁力文先生的书画作品包含了深远的文化，对地方文化建设有着积极的意义，希望图书馆能进一步深化文化建设等，让更多的艺术家及文化学者的作品珍藏在我校图书馆，促进图书馆的发展。来宾们一起参观了书画展以及图书馆，对图书馆的藏书、环境、学习氛围、文化等表示赞赏。据悉，梁力文先生共捐赠给我校图书馆17幅书画作品，有东坡诗意画《卷地风来忽吹散，望湖楼下水如天》、诗意画《罗浮仙境图》、隶书联句《读书千载经纶志，松柏四时潇洒心》等。');
INSERT INTO `newslist` VALUES (8, '图书馆深入地理与旅游学院开展专题讲座', '2019-12-14 20:14:28', 'data:image/png;base64,', '为满足地理与旅游学院师生的个性化需求，使他们掌握PPT的制作方法与技巧，2019年12月18日下午，图书馆到11号楼106教室开展题为“PPT的制作与PS技巧”的讲座，地理与旅游学院师生聆听了讲座。讲座由“设计师之家”数据库的资深讲师黄志文老师主讲。\r\n黄老师首先深入浅出地讲解了PPT制作的封面设计、封底设计、目录页设计、过渡页设计和正文设计。他提出封面的设计原则为简约大方、主题突出、素材关联、颜色一致、风格一致；封底的内容要尽量使用和封面类似的版面，形成前后呼应的效果；目录的设计技巧在于标识点缀，章节突出，也可以加入页码融景；过渡页体现的是每个章节中的主要内容，其作用在于承接上下文；正文页表现为标题栏的设计和正文排版技巧。接着，在PS方面，黄老师主要讲解了钢笔抠图、蒙版+画笔抠图、通道抠图、锁套选取、魔棒选取等抠图方法，以及常用的套索工具橡皮擦工具。最后，黄老师与师生们展开了有奖问答互动交流，现场气氛热烈，师生们踊跃参与，积极抢答。\r\n通过这次培训，师生们掌握了PPT的制作方法与技巧，对PPT的强大功能有了明确的认识。\r\n');
INSERT INTO `newslist` VALUES (9, '“感悟专业 学海无涯”图书馆资源与服务专题讲座', '2019-12-24 20:15:12', 'data:image/png;base64,', '为使学生进一步提高图书馆资源的利用率，12月18日下午，地理与旅游学院在新实验楼106课室开展了以“感悟专业学海无涯”为主题的图书馆资源与服务推介讲座，讲座由图书馆黄于洋老师主讲，地旅学院辅导员黄文苑老师主持。\r\n讲座上，黄于洋老师向同学们介绍了图书馆的概况和书目检索系统的使用方法，着重推介了图书馆的三大新亮点——智慧学习空间、24小时智慧图书馆及特藏文献室，并分类展示了可用数字资源及使用方法，引导大家合理利用丰富的馆藏资源开展学习研究。同时，针对同学们在使用图书馆资源时可能遇到的种种问题，黄老师结合实际例子，以轻松活泼的方式为大家将谜团逐一解开。最后，黄老师勉励同学们以“变革梨子”的精神，主动了解并充分利用图书馆资源，营造良好的校园学习氛围，让自己的大学生活更有意义。\r\n');
INSERT INTO `newslist` VALUES (10, '刘国栋副校长到图书馆开展调研', '2019-12-23 20:15:44', 'data:image/png;base64,', '12月16日下午，副校长刘国栋到图书馆开展调研，认真听取图书馆关于近期工作情况、存在问题以及下一步工作思路的详细汇报，对图书馆工作提出指导意见。图书馆科级以上干部、部分业务骨干参加了调研会。\r\n　　刘国栋对图书馆在服务师生、服务教学科研等方面所做的工作和取得的成绩表示充分肯定，对图书馆下一步工作提出了三点意见：一是要以党的政治建设为统领，不忘初心、牢记使命，增强“四个意识”、坚定“四个自信”、做到“两个维护”,积极探索服务教学科研的新模式，以更高的要求和标准开展各项工作；二是进一步加强制度建设和人才队伍建设，为图书馆未来健康发展奠定坚实基础；三是切实加强文化环境建设，切实提高安全意识，在努力把图书馆建设成为“学习中心”和“文化中心”的同时，切实保障图书馆消防、防盗、网络、意识形态等综合安全。\r\n');
INSERT INTO `newslist` VALUES (11, '刘国栋副校长到图书馆检查指导工作', '2020-05-15 17:07:00', 'data:image/png;base64,', '2020年3月17日下午，刘国栋副校长到图书馆就疫情防控工作进行检查指导，资产管理处处长杨敏、后勤与基建管理处副处长黄岳文陪同。\r\n馆长杨勇就图书馆疫情防控期间的线上服务、场馆管理、人员管理、服务措施等进行了汇报，邹富联、黎邦群两位副馆长也分别就所分管部门开展的服务工作作了汇报。\r\n刘国栋副校长充分肯定了图书馆在疫情防控期间为满足全校师生的文献信息需求，保障学校的网络教学、科研工作付出的努力。他强调，一定要高度重视疫情防控，高度重视安全管理。一是做好科学防控，做好疫情防控工作预案；二是工作人员管理要到位，要充分关心和掌握老师的健康状况；三是保证防疫工作的安全管理，确保防疫物资的落实；四是有序推进图书馆各项工作，加强图书馆文献资源保障体系建设，提升教学科研和社会化服务功能，使图书馆成为学校的知识中心、学习中心、文化中心和服务中心。\r\n\r\n撰稿：黄晓芳\r\n审稿：邹富联\r\n签发：杨勇\r\n');

