-- ----------------------------
-- Procedure structure for cancelOrder
-- ----------------------------
DROP PROCEDURE IF EXISTS `cancelOrder`;
delimiter ;;
CREATE DEFINER=`root`@`%` PROCEDURE `cancelOrder`()
BEGIN
/* 更新userseat表的*/
	UPDATE userseat SET isok = "N" WHERE current_time() > ordertimeend AND isok = "D";
/* 更新allseat表的*/
	UPDATE allseat SET ishavepeople = "N",IsOkToOrder = "Y" ,begintime = NULL,endtime = NULL 
	WHERE current_time() > endtime AND IsOkToOrder='D' AND ishavepeople='N';
END
;;
delimiter ;

-- ----------------------------
-- Event structure for FindCO
-- ----------------------------
DROP EVENT IF EXISTS `FindCO`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `FindCO`
ON SCHEDULE
EVERY '5' MINUTE STARTS '2020-05-20 23:00:00'
DO call cancelOrder()
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
